DROP TABLE IF EXISTS `game_review`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `game_review` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `game_id` int unsigned NOT NULL COMMENT 'ID Игры',
  `user_id` int unsigned NOT NULL COMMENT 'ID Пользователя',
  `rate` int unsigned NOT NULL COMMENT 'Оценка игры от 1 до 5',
  `review` text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT 'Текст обзора (не обязательно)',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Обзоры Игр';
