DROP TABLE IF EXISTS `games`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `games` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название игры',
  `developer_id` int unsigned NOT NULL COMMENT 'ID Разработчика',
  `age_rating_id` int unsigned NOT NULL COMMENT 'ID Возрастного рейтинга',
  `genre_id` int unsigned NOT NULL COMMENT 'Жанр',
  `price` decimal(11,2) DEFAULT NULL COMMENT 'Цена',
  `description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Описание',
  `media_id` int unsigned NOT NULL COMMENT 'ID image из media',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `title` (`title`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Игры';
/*!40101 SET character_set_client = @saved_cs_client */;

